import React from 'react'
import { useParams } from 'react-router-dom'
import logements from '../../assets/logements.json'
import Carrousel from '../../components/Carrousel'
import starTrue from '../../assets/starTrue.svg'
import starFalse from '../../assets/starFalse.svg'
import Tag from '../../components/Tag'
import styled from 'styled-components'

const FicheLogement = styled.div`
  width: 1440px;
`

const LogementsProprietaires = styled.div``

function Fiche() {
  /*Récupération de la fiche dans les données JSON */
  const id = useParams()
  const ficheLogement = logements.find((logement) => logement.id === id.id)

  /*Idem pour les Tags */
  const tagsLogement = logements.map((tags, index) => {
    return <Tag key={index} nom={tags} />
  })

  /*Idem pour les Rates */

  return (
    <Fiche>
      return (
      <FicheLogement>
        <Carrousel />

        <LogementsProprietaires></LogementsProprietaires>
      </FicheLogement>
      )
    </Fiche>
  )
}
export default Fiche
